import React from "react";

const Header = () => (
  <div className="header grid">
    <h1 className="title" />
  </div>
);

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
          'hello i am editting this' Edit <code>src/App.js</code> and save to
          reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
